settings.colorFunction:
var type = dsData[dsIndex]['type'];
if (type == 'colorpin') {
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120 * 100;
	    return tinycolor.mix('blue', 'red', amount = percent).toHexString();
	}
	return 'blue';
}

settings.markerImageFunction:
var weight = dsData[dsIndex]['weight'] || 0;
var index = Math.floor((weight / 200) * 4);
if (index > 3) index = 3;
index = dsIndex*4 + index;
return {
  size: 60,
  url: images[index]
};

settings.tooltipFunction:
var deviceType = dsData[dsIndex]['deviceType'];
if (typeof deviceType !== undefined) {
    if (deviceType == "energy meter") {
        return '<b>${entityName}</b><br/><b>Energy:</b> ${energy:2} kWt<br/>';
    } else if (deviceType == "thermometer") {
        return '<b>${entityName}</b><br/><b>Temperature:</b> ${temperature:2} °C<br/>';
    }
}

settings.labelFunction:
var colors = ["#85b129", "#228efc", "#e05aef"];
var colorIndex = dsIndex % colors.length;
var color = colors[colorIndex];
return "<div style='position: relative; white-space: nowrap; text-align: center; font-size: 16px; top: -5px;'><span style='margin-left: -500%;'></span><span style='border: solid "+color+"; border-radius: 10px; color: "+color+"; background-color: #fff; padding-left: 5px; padding-right: 5px; padding-top: 3px; padding-bottom: 3px;'>${entityName}</span><span style='margin-right: -500%;'></span></div>";
